// src/components/SongCard.js
import React from "react";
import "./SongCard.css";

function SongCard({ song }) {
  return (
    <div className="song-card">
      <h3>{song.title}</h3>
      <p>{song.artist}</p>
      <span>{song.duration}</span>
    </div>
  );
}

export default SongCard;
